import React from 'react';
import s from './Dialogs.module.css';

const Dialogs = (props) => {
    return(
        <div className={s.dialogsWrapper}>
            <div className={s.dialogs}>
                <div className="dialog">Mike</div>
                <div className="dialog">Andrew</div>
                <div className="dialog">Coco</div>
                <div className="dialog">Frank</div>
                <div className="dialog">Maggie</div>
                <div className="dialog">Ray</div>
            </div>
            <div className={s.messages}>
                <div className="message">Hi!</div>
                <div className="message">Hi! How are you?</div>
                <div className="message">Im fine, and you?</div>
            </div>
        </div>
    )
}

export default Dialogs;
